               '\t\t}\n'
               '\t\telse if (balance - withdraw < 0)\n'
               '\t\t{\n'
               '\t\t\tcout << " You do not have such balance of money in your '
               'account!\\n";\n'
               '\t\t\tcout << " Your balance is " << balance << endl;\n'
               '\t\t\tsystem("pause");\n'
               '\t\t\tsystem("cls");\n'
               '\t\t\tWithdraw();\n'
               '\t\t}\n'
               '\t\telse\n'
               '\t\t{\n'
               '\t\t\tcout << " Your account balance is less than 100$.\\n You '
