               '\tfloat a, b, Area;\n'
               '\tcout << "Please enter the length of Rectangle: ";\n'
               '\tcin >> a;\n'
               '\tcout << "Please enter the width of Rectangle: ";\n'
               '\tcin >> b;\n'
               '\tif (a > 0 && b > 0)\n'
               '\t{\n'
               '\t\tArea = a * b;\n'
               '\t\tcout << "The area of Rectangle is " << Area << ";" << '
               'endl;\n'
               '\t}\n'
               '\telse\n'
               '\t{\n'
               '\t\tcout << "The sides of Rectangle cannot be negative numbers '
