               '\tcout << "Kilometers: ";\n'
               '\tcin >> k1;\n'
               '\tcout << "Meters: ";\n'
               '\tcin >> m1;\n'
               '\tif (m1 > 1000)\n'
               '\t{\n'
               '\t\tk1 = m1 / 1000;\n'
               '\t}\n'
               '\tcout << endl\n'
               '\t\t << endl;\n'
               '\n'
               '\tcout << "Second distance: \\n";\n'
               '\tcout << "Kilometers: ";\n'
               '\tcin >> k2;\n'
               '\tcout << "Meters: ";\n'
               '\tcin >> m2;\n'
               '\tif (m2 > 1000)\n'
